import React, { useState } from 'react';
import axios from 'axios';

const App = () => {
    const [selectedFile, setSelectedFile] = useState(null);
    const [extractedText, setExtractedText] = useState('');
    const [jsonData, setJsonData] = useState(null);
    const [allOCRData, setAllOCRData] = useState([]);

    useEffect(() => {
      // Fetch all OCR data when the component mounts
      fetchAllOCRData();
  }, []);

  const handleFileChange = (e) => {
      setSelectedFile(e.target.files[0]);
  };

    const handleUpload = () => {
        if (!selectedFile) return;

        const formData = new FormData();
        formData.append('image', selectedFile);

        axios.post('http://localhost:5000/upload', formData, {
            headers: {
                'Content-Type': 'multipart/form-data',
            },
        })
            .then(response => {
                setExtractedText(response.data.text);
                const lines = response.data.text.split('\n');
                const parsedData = parseExtractedText(lines);
                setJsonData(parsedData);

                // Send the JSON data string to the server
                axios.post('http://localhost:5000/uploadJson', { jsonData: JSON.stringify(parsedData, null, 2) })
                    .then(serverResponse => {
                        console.log(serverResponse.data.message);
                    })
                    .catch(error => console.error(error));
            })
            .catch(error => console.error(error));

    };

    const parseExtractedText = (lines) => {
        const jsonData = {
            identification_number: extractValue(lines, /\b(\d{1,4}\s*){5,}\d{1,4}\b/),
            name: extractValue(lines, /Name\s*([\s\n]*[A-Za-z]+\s[A-Za-z]+)/, 'Name'),
            last_name: extractValue(lines, /Last [nN]ame\s*([\s\n]*[A-Za-z]+)/, 'Last name'),
            date_of_birth: extractValue(lines, /\d{1,2}\s[A-Za-z]+\s\d{4}/, 'Date of Birth'),
            date_of_issue: extractDate(lines, 'Date of Issue'),
            date_of_expiry: extractDate(lines, 'Date of Expiry'),
        };

        return jsonData;
    };

    const extractDate = (lines, keyword) => {
        for (let i = 1; i < lines.length; i++) {
            if (lines[i].includes(keyword)) {
                return lines[i - 1].trim(); // Return the line above the "Date of Issue"
            }
        }
        return '';
    };

    const extractValue = (lines, regex, removeWord) => {
        const line = lines.find((line) => regex.test(line));
        if (line) {
            const value = line.replace(removeWord, '').trim();
            return value;
        }
        return "";
    };

    const fetchAllOCRData = () => {
      // Fetch all OCR data from the server
      axios.get('http://localhost:5000/ocrData')
          .then(response => {
              setAllOCRData(response.data);
          })
          .catch(error => console.error(error));
  };

  const updateOCRData = (id, newData) => {
      // Update OCR data on the server
      axios.put(`http://localhost:5000/ocrData/${id}`, newData)
          .then(response => {
              console.log(response.data.message);
              // After updating, fetch all OCR data to update the list
              fetchAllOCRData();
          })
          .catch(error => console.error(error));
  };

    const deleteOCRData = (id) => {
      // Delete OCR data on the server
      axios.delete(`http://localhost:5000/ocrData/${id}`)
          .then(response => {
              console.log(response.data.message);
              // After deleting, fetch all OCR data to update the list
              fetchAllOCRData();
          })
          .catch(error => console.error(error));
  };

  return (
    <div>
        <h1>Vision API OCR</h1>
        <input type="file" accept="image/*" onChange={handleFileChange} />
        <button onClick={handleUpload}>Upload and Process</button>
        <div>
            <h2>Extracted Text:</h2>
            <pre>{extractedText}</pre>
            <h2>JSON Data:</h2>
            <pre>{JSON.stringify(jsonData, null, 2)}</pre>
        </div>
        <div>
            <h2>All OCR Data:</h2>
            <ul>
                {allOCRData.map((ocrData) => (
                    <li key={ocrData._id}>
                        {`ID: ${ocrData._id}, Identification Number: ${ocrData.identification_number}, Name: ${ocrData.name}`}
                        {/* Add other fields as needed */}
                        <button onClick={() => updateOCRData(ocrData._id, { name: 'New Name' })}>
                            Update
                        </button>
                        <button onClick={() => deleteOCRData(ocrData._id)}>
                            Delete
                        </button>
                    </li>
                ))}
            </ul>
        </div>
    </div>
);
};

export default App;
